MongoDB aggregation: Aggregate array into keyed objects<p>I'd like to flatten document array into a keyed objects using the aggregation functionality. Here’s an example of my documents:</p>

<pre><code>[ 
    {
        "_id": 1,
        "texts": [
            { "language": "english", "text": "hello" },
            { "language": "german", "text": "hallo" },
            { "language": "french", "text": "bonjour" }
        ]
    }, …
]
</code></pre>

<p>Expected result:</p>

<pre><code>[
     {
        "_id": 1,
        "texts": {
            "english": "hello",
            "german": "hallo",
            "french": "bonjour"
        }
    }, …
]
</code></pre>

<p>I’ve looked at different operators, e.g. <code>$map</code>, but this seems to be focued on transforming array to array. I’d probably need a JS equivalent of <code>$reduce</code>, but couldn’t find a way of accumulating my values into an object.</p>

<p>Any ideas?</p>

answer:
Great Rick, thank you. The two matrices in my case were:given M the complete matrix, X contains the columns where there aren't any missing values, Y the columns where there are missing values.
I defined two indexes: missidx=loc(countmiss(M,"ROW")^=0; compidx=loc(countmiss(M,"ROW")=0; 
Then I computed the complete corr matrix with MCor=corr(M,"pearson","pairwise"); and gained the desired result with XYCor=MCor[compidx,missidx]; Thank you for your help and thank you for your blog with inspiring contents.

