Capture values from multiple select form and POST via Flask<p>I need to capture multiple select form vlaue (generated from a MongoDB collection ) and POST via a Flask route to another MongoDB collection: <code>recipes</code></p>

<p>Below is the relevant form div:</p>

<pre><code>&lt;form action="{{ url_for('insert_recipe') }}" method="POST" class="col s12"&gt;
    ...

        &lt;div class="input-field col s6 l6"&gt;
            &lt;i class="material-icons prefix"&gt;warning&lt;/i&gt;
            &lt;select multiple id="allergen_name" name="allergenlist"&gt;
                &lt;option value="" disabled selected&gt;Choose allergens&lt;/option&gt;
                {% for allergen in allergens %}
                &lt;option value="{{allergen.allergen_name}}"&gt;{{allergen.allergen_name}}&lt;/option&gt;
                {% endfor %}
            &lt;/select&gt;
        &lt;/div&gt;
    &lt;/div&gt;

    ...

&lt;/form&gt;
</code></pre>

<p>I want to capture the selected options and POST them via Flask:</p>

<pre><code># Get all recipes
@app.route('/get_recipes')
def get_recipes():
    return render_template("recipes.html", 
    recipes=mongo.db.recipes.find())

# Render HTML form
@app.route('/add_recipe')
def add_recipe():
    return render_template('addrecipe.html',
    users=mongo.db.users.find(),
    allergens=mongo.db.allergens.find(),
    cuisines=mongo.db.cuisine.find(),)

# Send the form    
@app.route('/insert_recipe', methods=['POST'])
def insert_recipe():
    recipes =  mongo.db.recipes
    recipes.insert(request.form.to_dict())
    return redirect(url_for('get_recipes'))
</code></pre>

<p>However, only the first selected option is being captured and sent.</p>

<p>Any help would be appreciated.</p>

<p>EDIT:
When looking at: <a href="http://werkzeug.pocoo.org/docs/0.12/datastructures/#werkzeug.datastructures.MultiDict.to_dict" rel="nofollow noreferrer">http://werkzeug.pocoo.org/docs/0.12/datastructures/#werkzeug.datastructures.MultiDict.to_dict</a></p>

<p>... relaised that I need to set <code>to_dict(flat=false)</code> in order to have all values of <code>dict</code> returned.</p>

