Run aggregrate query in mongocxx as a string literal<p>In the mongocxx API, <a href="https://mongodb.github.io/mongo-cxx-driver/api/mongocxx-v3/classmongocxx_1_1collection.html#aa93a46c9e07878fbddeb3ca29af71fc4" rel="nofollow noreferrer">Collection.aggregate()</a> expects a pipeline object in order to run an <a href="https://docs.mongodb.com/manual/aggregation/#aggregation-pipeline" rel="nofollow noreferrer">aggregate pipeline</a> query. This means constructing the query by using the Pipeline class. Such as:</p>

<pre><code>    mongocxx::pipeline p{};
    p.match(make_document(kvp("items.fruit", "banana")));
    p.sort(make_document(kvp("date", 1)));
    auto cursor = db["sales"].aggregate(p, mongocxx::options::aggregate{});
</code></pre>

<p>Is there a way to run an aggregate pipeline query in mongocxx by passing in a string? I'm not looking to construct the query using a mongocxx object, but running the query as a string.</p>

<p>For example:</p>

<pre><code>    db["sales"].aggregate("[{"$match": {  ... }}"]
</code></pre>

<p>where "[{"$match": {  ... }}" is a pipeline aggregate query of type std::string.</p>

