Non-existing field in Mongodb document appears in mongoose findById() result<p>I'm somewhat new in what is related to Mongoose and I came to this behaviour I consider as strange. The document returned by Mongoose has fields that are not present in the actual MongoDb document, and seem to be added by Mongoose based on the schema.</p>

<p>I use a schema similar to this (this one is simplified) :</p>

<pre><code>const ProfessionalSchema = new mongoose.Schema({

    product: {
       details: [{
            _id: false,
            id: String, // UUID
            name: String,
            prestations: [{
                _id: false,
                id: String, // UUID
                name: String,
                price: Number,
            }],
        }],
    },
[...]
</code></pre>

<p>My document as shown in Mongodb with mongo CLI utility doesn't have a product field.</p>

<p>What I don't understand is why the result of Professional.findById().exec() returns a document with a product:{details[]} field. I expect not to have that field in the Mongoose returned result, since it is not present in the original MongoDb document.
The Mongoose documentation found <a href="https://mongoosejs.com/docs/guide.html" rel="nofollow noreferrer">https://mongoosejs.com/docs/guide.html</a> (Schema and Model paragraph) didn't help.</p>

<p>My business logic would require that field not to be present, instead of being forced by the schema. Is this achievable ?</p>

