Render multiple query result<p>In my HTML page, I need to show the total number of items bought this day and below I have to display all the datas. Its a simple thing but I am not sure how to do it in NodeJS.</p>

<p>I am trying following code:</p>

<h2>index.js</h2>

<pre><code>var HL = require('../modules/history-list');

app.get('/activity', function (req, res) {
    if (req.session.user == null) {
        res.redirect('/');
    } else {
        HL.getTotalRecords(function (e, count) {
            res.render('activity', {
                title: 'My Activity',
                udata: req.session.user, 
                count: count
            });
        });

        HL.getAllRecords(function (e, activities) {
            res.render('activity', {
                title: 'My Activity',
                udata: req.session.user, 
                activities: activities
            });
        });
    }
});
</code></pre>

<h2>history-list.js</h2>

<pre><code>exports.getTotalRecords = function (callback) {
    let start = moment().startOf('day');
    let end = moment().endOf('day');

    history.aggregate([{
            "$addFields": {
                "date": {
                    "$dateFromString": {
                        "dateString": "$date"
                    }
                }
            }
        },
        {
            "$match": {
                "date": {
                    "$gte": start.toDate(),
                    "$lt": end.toDate()
                }
            }
        },
        {
            "$count": "count"
        }
    ]).toArray(function (e, res) {
        if (e) callback(e)
        else callback(null, res);
    });
}

exports.getAllRecords = function (callback) {
    history.find({}, function (e, res) {
        if (e) callback(e)
        else callback(null, res);
    });

}
</code></pre>

<p>I am getting <code>Error: Can't set headers after they are sent.</code> error as I have res.render twice. I am not sure how can I fix it. </p>

<p>Any help will be appreciated.</p>

<p>Thank You</p>

