Preventing MongoDB Multiple Connections in NodeJS<p>I've seen a few posts on this topic; one of which has helped me progress - but I still have a problem.</p>

<p>My Mongo database is being flooded with connections and throwing errors. I do have multiple different connections which I am establishing using customer name. Online I found this useful class: </p>

<pre><code>export default class ConnectionManager {
static databases: any = {};

static getConnection(customer: string) : Promise&lt;typeof mongoose&gt; {
    if (this.databases[customer]) return Promise.resolve(this.databases[customer]);

    return new Promise&lt;typeof mongoose&gt;((resolve: any, reject: any) =&gt; {
        mongoose.connect(process.env.MONGOOSE_BASE_SERVER_URL + customer, { useNewUrlParser: true })
            .then((newDb: mongoose.Mongoose) =&gt; { 
                this.databases[customer] = newDb;
                resolve(this.databases[customer]);
            });
    });
  }
}
</code></pre>

<p>As I've mentioned, this helps - it works if a connection already exists.</p>

<p>The trouble is I have a scheduled task which could immediately flood the API with requests after existing connections have timed out. If the API is flooded with requests at this point - they come in too quickly and it opens up hundreds of connections and I still encounter the same problem; before ConnectionManager.databases has had chance to be updated with a new connection.</p>

<p>Racking my brains to think of a way of avoiding this. Does anyone have any advice?</p>

<p>Thanks,</p>

